LEFT JOIN `stocks` ON `tasks`.`acoustic_id` = `stocks`.`id`
LEFT JOIN `stocks` as `stocks_2` ON `tasks`.`acoustic_id_2` = `stocks_2`.`id`
LEFT JOIN `models` ON `stocks`.`ha_model` = `models`.`id`
LEFT JOIN `series` ON `models`.`series` = `series`.`id`
LEFT JOIN `manufacturers` ON `series`.`brand` = `manufacturers`.`id`
LEFT JOIN `doctors` ON `customers`.`doctor` = `doctors`.`id`
WHERE `customers`.`selling_point` = 2
AND   (
`tasks`.`scan` =0
OR `tasks`.`gnomateusi` =0
OR `tasks`.`tel_rdv` =0
OR `tasks`.`ektelesi` =0
OR `tasks`.`signatures` =0
OR `tasks`.`receipt` =0
OR `tasks`.`arxeio` =0
OR `stocks`.`day_out` =0
OR `stocks`.`day_in` =0
 )
